import React from 'react';

let imageArray = [];

let currentGameArray = [];

let currentScore = 0;
let highScore = 0;

const randomImage = () =>{
    // console.log(imageArray);
    let randomNumber = (Math.floor(Math.random() * 49)+1);
    if(imageArray.includes(randomNumber)){
        return randomImage();
    }
    else{
        imageArray.push(randomNumber);
        return "/us-flags/"+randomNumber+".png";
    }
}

const styles = {
    container:{
        paddingTop: "50px",
        paddingBottom: "50px",
        display: "flex",
        flexWrap: "wrap",
        margin: "0 auto",
        justifyContent: "center",
    }
};

const changeImages = () =>{
    const styles = {
        images: {
            height: "150px",
            width: "150px",
            margin: "8px 25px",
            display: "block",
            backgroundImage: 'url(' + randomImage() + ')',
            backgroundSize: "contain",
            backgroundRepeat: "no-repeat",
            backgroundPosition: "center",
        }
    };
    // conssole.log(styles);
    return styles.images;
}

const imageClicked = (e) =>{
    // console.log(e.target.style.backgroundImage);
    // console.log(currentGameArray);
    // console.log(currentScore);
    // console.log(highScore);
    let backgroundURL = e.target.style.backgroundImage;
    if(currentGameArray.includes(backgroundURL)){
        //reset score, clear array, etc
        currentScore=0;
        // highScore=0;
        currentGameArray=[];
        document.getElementById("game-scores").innerHTML = "Score: "+currentScore+" | Top Score: "+highScore;
        changeImages();
    }
    else{
        currentGameArray.push(backgroundURL);
        currentScore++;
        if(currentScore>=highScore){
            highScore=currentScore;
        }
        document.getElementById("game-scores").innerHTML = "Score: "+currentScore+" | Top Score: "+highScore;
    }
    shuffleBoard(document.getElementsByClassName("click-item"));
};

const shuffleArray = (array) => {
    for (var i = array.length - 1; i > 0; i--) {
        var j = Math.floor(Math.random() * (i + 1));
        var temp = array[i];
        array[i] = array[j];
        array[j] = temp;
    }
    return array;
}

const shuffleBoard = (elems) => {

        var divs = elems;
        // console.log(divs);
        let newDivs = shuffleArray(divs);
        console.log(newDivs);
        for(let i = 0; i<newDivs.length; i++){
            console.log(newDivs[i]);
            if(i<4){
                // console.log("row 1 append");
                document.getElementById("row1").appendChild(newDivs[i]);
            }
            else if(i<8){
                // console.log("row 2 append");
                document.getElementById("row2").appendChild(newDivs[i]);
            }
            else{
                // console.log("row 3 append");
                document.getElementById("row3").appendChild(newDivs[i]);
            }
        }
}


function Game (){
    changeImages();
    return(
        <main className="container" id="gameBoard" style={styles.container}>
            <div className="row" id="row1">
                <div role="img" aria-label="click item" className="click-item" style={changeImages()} onClick={imageClicked}>
                </div>
                <div role="img" aria-label="click item" className="click-item" style={changeImages()} onClick={imageClicked}>
                </div>
                <div role="img" aria-label="click item" className="click-item" style={changeImages()} onClick={imageClicked}>
                </div>
                <div role="img" aria-label="click item" className="click-item" style={changeImages()} onClick={imageClicked}>
                </div>
            </div>
            <div className="row" id="row2">
                <div role="img" aria-label="click item" className="click-item" style={changeImages()} onClick={imageClicked}>
                </div>
                <div role="img" aria-label="click item" className="click-item" style={changeImages()} onClick={imageClicked}>
                </div>
                <div role="img" aria-label="click item" className="click-item" style={changeImages()} onClick={imageClicked}>
                </div>
                <div role="img" aria-label="click item" className="click-item" style={changeImages()} onClick={imageClicked}>
                </div>
            </div>
            <div className="row" id="row3">
                <div role="img" aria-label="click item" className="click-item" style={changeImages()} onClick={imageClicked}>
                </div>
                <div role="img" aria-label="click item" className="click-item" style={changeImages()} onClick={imageClicked}>
                </div>
                <div role="img" aria-label="click item" className="click-item" style={changeImages()} onClick={imageClicked}>
                </div>
                <div role="img" aria-label="click item" className="click-item" style={changeImages()} onClick={imageClicked}>
                </div>
            </div>
        </main>
    );
}

export default Game;
